// HomePage.js
import React from 'react';
import yourSvg from './components/HomePage.svg';

const HomePage = () => {
  return (
    <div style={{ width: '100vw', height: '100vh', overflow: 'hidden' }}>
      <img src={yourSvg} alt="Your SVG" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />

      {/* <div> */}
        <video autoPlay loop muted playsInline>
          <source src="./components/background.mp4" type="video/mp4"></source>
        </video>
      {/* </div> */}
    </div>
  );
};

export default HomePage;
